class ListOfProjects extends Component {
   shoot() {
        alert(<p>{this.props.name}</p> );
      } 
    render() {
        return (
            <div >
                    <div id="im">
                        <img className="foto" src={this.props.photo} onClick={this.shoot}/>
                         <p>{this.props.name}</p> 
                    </div>
            </div>
        );
    }
}

export default ListOfProjects;
